import Home from './Home'
import ImagePredection from './ImagePredection';
import Disease from './Diseases';
import  DiseasesCard from './Diseases/Diseases-card';

import './App.css';

const diseasesList=[
  {
    id:1,
    name:"White Spot Syndrome (WSS)",
    diseaseImg:"https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg"
  },{
    id:2,
    name:'Yellow Head Disease (YHD)',
    diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
  },{
    id:3,
    name:"Vibriosis",
    diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
  },{
    id:4,
    name:'Black Gill Disease',
    diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
  },{
    id:5,
    name:'Taura Syndrome',
    diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
  },{
    id:6,
    name:"Infectious Hypodermal and Hematopoietic Necrosis (IHHN)",
    diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
  }
]

function App() {
  return (
    <div>
      <Home/>
      <ImagePredection/>
      <Disease diseasesList={diseasesList}/>
      <DiseasesCard/>
    </div>
  );
}

export default App;
